import React, { useState } from "react";

const Form = () => {
  const [formData, setFormData] = useState({
    name: "",
    gender: "",
    age: 0,
    work: "",
    residence: "",
    marriage: "",
    bmi: 0.0,
    smoking: "",
    avg_glucose_level: 0.0,
  });

  const handleChange = (e) => {
    setFormData((prevData) => ({
      ...prevData,
      [e.target.name]: e.target.value,
    }));
    console.log(e.target.name, e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log(formData);
  };

  //     const generateBMI = () => {
  //         const options = [];
  //         for (let i = 0; i < 99; i++){
  //             options.push(i)
  //         }
  //   };
  return (
    <div className="flex flex-col justify-center items-center h-screen">
      <h1 className="text-4xl font-bold mt-5 mb-5">Stroke Risk Prediction</h1>
      <form className="w-full max-w-md" onSubmit={handleSubmit}>
        <div className="flex"></div>

        <div className="mb-4">
          <label
            className="block text-gray-700 text-sm font-bold mb-2"
            htmlFor="marriage"
          >
            Marriage Status
          </label>

          <select
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            id="marriage"
            value={formData.marriage}
            onChange={handleChange}
            name="marriage"
          >
            <option value={null}>Select Your Marriage Status</option>
            <option value="single">Single</option>
            <option value="married">Married</option>
            <option value="divorced">Divorced</option>
          </select>
        </div>

        <div className="mb-4">
          <label
            className="block text-gray-700 text-sm font-bold mb-2"
            htmlFor="email"
          >
            Smoking Status
          </label>

          <select
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            id="smoking"
            value={formData.residence}
            onChange={handleChange}
            name="smoking"
          >
            <option value="">Select Your Smoking Status</option>
            <option value="smoke">Smokes</option>
            <option value="never-smoked">Never-Smoked</option>
            <option value="formerly-smoked">Formerly Smoked</option>
          </select>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2">
            Average Glucose Level (mmol/L)
          </label>
          <input
            id="avg_glucose_level"
            name="avg_glucose_level"
            placeholder="Enter Average Glucose Level"
            type="number"
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            value={formData.avg_glucose_level}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-4">
          <label
            className="block text-gray-700 text-sm font-bold mb-2"
            htmlFor="name"
          >
            BMI
          </label>

          <input
            id="bmi"
            name="bmi"
            placeholder="Enter BMI"
            type="number"
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            value={formData.bmi}
            onChange={handleChange}
            required
          />
        </div>

        <div className="flex items-center justify-center">
          <button
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
            type="submit"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default Form;
